CREATE TABLE IF NOT EXISTS nilai_siswa(
   no                         INTEGER  NOT NULL PRIMARY KEY 
  ,kelas                      INTEGER  NOT NULL
  ,subkelas                   VARCHAR(1) NOT NULL
  ,nama_depan                 VARCHAR(11) NOT NULL
  ,nama_belakang              VARCHAR(11) NOT NULL
  ,email                      VARCHAR(42) NOT NULL
  ,jenis_kelamin              VARCHAR(9) NOT NULL
  ,mimpi                      VARCHAR(21) NOT NULL
  ,nilai_matematika           INTEGER  NOT NULL
  ,nilai_bahasa_indonesia     INTEGER  NOT NULL
  ,nilai_bahasa_inggris       INTEGER  NOT NULL
  ,nilai_pendidikan_pancasila INTEGER  NOT NULL
  ,nilai_fisika               INTEGER  NOT NULL
  ,nilai_kimia                INTEGER  NOT NULL
  ,nilai_biologi              INTEGER  NOT NULL
  ,nilai_ips                  INTEGER  NOT NULL
  ,nilai_seni_budaya          INTEGER  NOT NULL
  ,nilai_informatika          INTEGER  NOT NULL
  ,nilai_agama                INTEGER  NOT NULL
  ,nilai_pjok                 INTEGER  NOT NULL
  ,nilai_keterampilan_pilihan INTEGER  NOT NULL
  ,nama_depan_ortu            VARCHAR(10) NOT NULL
  ,nama_belakang_ortu         VARCHAR(11) NOT NULL
);
